(2179, 3, 'view_archive_list', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/136.0.0.0 Safari/537.36', 'Pengguna Rendy_Adty melihat daftar arsip halaman 1 dengan urutan newest', '{\"page\": 1, \"sort\": \"newest\", \"query\": \"\\n            SELECT \\n                archives.id, \\n                archives.title, \\n                archives.file_name, \\n                archives.file_type, \\n                archives.file_size, \\n                archives.created_at, \\n                archives.is_public,\\n                categories.name AS category_name\\n            FROM archives\\n            JOIN archive_category ON archives.id = archive_category.archive_id\\n            JOIN categories ON archive_category.category_id = categories.id\\n            WHERE archives.user_id = %s\\n            ORDER BY archives.created_at DESC\\n            LIMIT %s OFFSET %s\\n        \", \"category_id\": \"\", \"date_range\": \"\", \"total_count\": 2}', NULL, '2025-05-24 02:36:07'),
